import { create } from 'zustand';
import axios from 'axios';



export const FormSearchStore = create((set, get) => {

    return ({
        data: {
            arrivalDate: "",
            leaveDate: "",
            members: 1,
            keywords: "",
        },
        fetchPkgSearch: [],
        handleChange: (event) => {
            const { name, value } = event.target;
            set((state) => {
                const { data } = state;
                data[name] = value;
                return {
                    ...state,
                    data: data
                }
            })
        },

        incrementMembers: (event) => {
            event.preventDefault();
            set((state) => {
                const { data } = state;
                data.members += 1;
                return {
                    ...state,
                    data: data
                }
            })
        },

        decrementMembers: (event) => {
            event.preventDefault();
            set((state) => {
                const { data } = state;
                if (data.members > 1) {
                    data.members -= 1;
                    return {
                        ...state,
                        data: data
                    }
                }
            })
        },
        handleSubmit: async (event) => {
            event.preventDefault()
            const { data } = get();
            try {
                const response = await axios.get('http://localhost:3000/search', { params: data })
                set({ fetchPkgSearch: response.data });
            } catch (error) {
                set({ error: 'Une erreur est survenue lors de la récupération des établissement' });
            }
        }
    })
})
